import styled from "styled-components";
import NotFound from "../../assets/img/NotFound.png";

export const Container = styled.div`
  background-image: url(${NotFound});
  background-repeat: no-repeat;
  background-size: cover;
  width: 100%;
  height: 100vh;
`;
